import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';
import {useState,useEffect} from 'react';

export default function Index(){

    const [viewphoto,setViewphoto] = useState([]);

    useEffect(()=>{
        fetch('http://localhost:3002/Viewfile/')
        .then(response=>response.json())
        .then(json=>setViewphoto(json));
    },[]);



    const handlesubmit = (event) => {
        event.preventDefault();
        var datastring = new FormData(event.target);
        var config = {headers:{"enctype":"multipart/form-data"}};

        axios.post('http://localhost:3002/Addfile',datastring,config)
        .then(function(response){
            if(response.data.status === 'error'){
                alert('Error');
                window.location.reload();
            }
            else if(response.data.status === 'uploaded'){
                alert('File Uploaded');
                window.location.reload();
            }
            else{
                alert('Contact Admin');
                window.location.reload();
            }
        })
        .catch(function(error){
            alert(error);
            window.location.reload();
        })

    }

    return(
        <>
        <div className="container">
            <div className="row">
                <div className="col-lg-3">&nbsp;</div>
                <div className="col-lg-6">
                <form onSubmit={handlesubmit}>
                <div className="table-responsive">
                    <table width="100%" className="table table-bordered">
                        <thead>
                            <tr>
                                <th colSpan={2} className="text-center">Image Upload</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>File to be upload</td>
                                <td>
                                    <input type="file" name="upload_file" id="upload_file" className="form-control"/>
                                </td>
                            </tr>
                            <tr>
                                <td colSpan={2}>
                                    <button type="submit" name="data_submit" id="data_submit" value="submit"
                                    className="btn btn-primary">
                                        <span>Upload</span>
                                    </button>
                                </td>
                            </tr>
                        </tbody>
                    </table>
                </div>
                </form>
                </div>
                <div className="col-lg-3">&nbsp;</div>
            </div>
            <div className="row mt-3">
                <div className="col-lg-3">&nbsp;</div>
                <div className="col-lg-6">
                <div className="table-responsive">
                        <table className="table table-bordered">
                            <thead>
                                <tr>
                                    <th>File Name</th>
                                    <th>Photo</th>
                                    <th>Date & Time</th>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    viewphoto.map((v,i)=>(
                                        <tr>
                                            <td>{v.file_name}</td>
                                            <td><img src={v.file_object+v.file_name} className="img-fluid"/></td>
                                            <td>{v.upload}</td>
                                        </tr>
                                    ))
                                }
                            </tbody>
                        </table>
                    </div>
                </div>
                <div className="col-lg-3">&nbsp;</div>
            </div>
        </div>
        </>
    )
}
